import React from 'react';
import { NavLink, useHistory } from 'react-router-dom';
import "./Navbar.css";
import logo from '../../assests/images/logo.png'; // Update the path to your logo image

const Navbar = () => {
  const history = useHistory();
  const isLoggedIn = localStorage.getItem("token") ? true : false;

  const handleLogout = () => {
    history.push('/star-rating'); // Navigate to the star rating page
  };

  return (
    <>
      <nav>
        <NavLink exact to="/" activeClassName="active-link">
          <img src={logo} alt="Logo" width="150" height="90" />
        </NavLink>

        <div>
          <ul id="navbar">
            <li>
              <NavLink to="/homepage" className="nav-link" activeClassName="active-link">
                Home
              </NavLink>
            </li>
            <li>
              <NavLink to="/developers" className="nav-link" activeClassName="active-link">
                Developers
              </NavLink>
            </li>
            <li>
              <NavLink to="/contactus" className="nav-link" activeClassName="active-link">
                Contact Us
              </NavLink>
            </li>
            {isLoggedIn ? (
              <li>
                <button
                  className="white_btn"
                  onClick={handleLogout}
                  data-testid="Logout-button"
                >
                  Logout
                </button>
              </li>
            ) : (
              <li>
                <NavLink to="/login" className="white_btn" data-testid="Login-button">
                  Login
                </NavLink>
              </li>
            )}
          </ul>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
